'use strict';

module.exports = {
	report: 'NOTIFICATION_REPORT',
	reportParser(report) {
		if (report['Notification Type'] === 'CO2' &&
			report.hasOwnProperty('Notification Status')) {
			console.log(report['Notification Status']);
			return report['Notification Status'] === 'On';
		}
		return null
	},
};
